Founder of Isha Foundation

Sadhguru is the founder of the Isha Foundation, a non-profit organization dedicated to the wellbeing of the individual and the world for the past three decades. Isha Foundation does not promote any particular ideology, religion, or race, but transmits the inner sciences of universal appeal.

Sadhguru has initiated several projects for social upliftment, education, and the environment through which millions of people in rural India have been given the means and methods to overcome poverty, improve their quality of life, and achieve community-based, sustainable development.

He has founded Isha Outreach, the social development branch of Isha Foundation, with the vision to empower the deprived sections of society towards improved health, education, and environmental wellbeing. The three vehicles of Isha Outreach are Project GreenHands (PGH), Action for Rural Rejuvenation (ARR), and Isha Vidhya, which provide an interconnected and comprehensive approach to transform the lives of the rural poor.

Sadhguru's inclusive and holistic approach to current issues and world affairs has impressed some of the most educated and skeptical minds on the planet. Sadhguru is regularly invited to speak at major global conferences such as TED, the Millennium World Peace Summit (UN), and the World Economic Forum (Davos). He has also been a special invitee to the Tallberg Forum, and has given talks on inclusive and responsible leadership at the Australian Leadership Retreat, the World Presidents Organization and the Young Presidents Organization.
